import React, { useState } from 'react';

function AddMarksForm() {
  const [studentId, setStudentId] = useState('');
  const [telugu, setTelugu] = useState('');
  const [hindi, setHindi] = useState('');
  const [english, setEnglish] = useState('');
  const [maths, setMaths] = useState('');
  const [science, setScience] = useState('');
  const [social, setSocial] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    const marksData = {
      telugu: parseInt(telugu),
      hindi: parseInt(hindi),
      english: parseInt(english),
      maths: parseInt(maths),
      science: parseInt(science),
      social: parseInt(social),
    };

    fetch(`http://localhost:8080/marks/${studentId}`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(marksData),
    })
      .then((response) => response.json())
      .then((data) => {
        console.log('Marks added:', data);
        // Reset form fields if needed
        setStudentId('');
        setTelugu('');
        setHindi('');
        setEnglish('');
        setMaths('');
        setScience('');
        setSocial('');
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="studentId">Student ID:</label>
        <input
          type="number"
          id="studentId"
          value={studentId}
          onChange={(e) => setStudentId(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="telugu">Telugu:</label>
        <input
          type="number"
          id="telugu"
          value={telugu}
          onChange={(e) => setTelugu(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="hindi">Hindi:</label>
        <input
          type="number"
          id="hindi"
          value={hindi}
          onChange={(e) => setHindi(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="english">English:</label>
        <input
          type="number"
          id="english"
          value={english}
          onChange={(e) => setEnglish(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="maths">Maths:</label>
        <input
          type="number"
          id="maths"
          value={maths}
          onChange={(e) => setMaths(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="science">Science:</label>
        <input
          type="number"
          id="science"
          value={science}
          onChange={(e) => setScience(e.target.value)}
          required
        />
      </div>
      <div>
        <label htmlFor="social">Social:</label>
        <input
          type="number"
          id="social"
          value={social}
          onChange={(e) => setSocial(e.target.value)}
          required
        />
      </div>
      <button type="submit">Add Marks</button>
    </form>
  );
}

export default AddMarksForm;
